import { Alert } from "react-bootstrap";

export function Cabecalho(props){
    return(
        <div>
            <Alert variant="info" className="text-center me-5 ms-5">
                <h3>
                    {props.texto}
                </h3>
               
            </Alert>
        </div>
    );
}
